import React from "react";

const ReviewItem = ({ index, todo }) => {

  return (
    <li>
      <div className="view">
        <div className="round">
          <input
            checked={todo.is_labeled}
            type="checkbox"
            id={todo.review_id}
            onChange={toggleTodo}
          />
          <label htmlFor={todo.id} />
        </div>
      </div>

      <div className={"labelContent" + (todo.is_labeled ? " labeled" : "")}>
        <div>{todo.paragraph_text}</div>
      </div>

    </li>
  );
};

export default ReviewItem;;
